import React, {useState} from 'react'
import './App.css'
import Todos from './components/Todos'


function App() {
  const [todos, setTodos] = useState([
    { text: "lorem  ipsum1" },
    { text: "lorem  ipsum2" },
    { text: "lorem  ipsum3" },

  ]);
  return (
    <div className="App">
      <header className="App-header">
        <h1>Reactors</h1>
        <div>
          {todos.map((todo, index) => {
            <Todos key={index} todo={todo} index={index} />
          })}
        </div>
      </header>
    </div>
  );
}

export default App;
